# Funcin para vaciar entradas del usuario
def __vaciarEntradas(__ventana):
    for key in __ventana.key_dict:
        key = str(key)
        if (key.startswith("input_") and str(type(__ventana[key])) == "<class 'PySimpleGUI.PySimpleGUI.Input'>"):
            __ventana[key].update(value = "")
        

# Funcin para cambiar de ventanas
__origenActual = "__layout_menuPrincipal"
def __cambiarVentanas(self, GlobalTienda, __ventana, destino):
    global __origenActual

    __vaciarEntradas(__ventana)
    if hasattr(__ventana.__globales[destino], "precarga"): __ventana.__globales[destino].precarga(__ventana, GlobalTienda)

    __ventana[__origenActual].update(visible=False)
    __ventana[destino].update(visible=True)
    __ventana.set_title("Blockbuster: "+__ventana[destino+"_titulo"].get())
    __origenActual = destino


# Funcin para generar ventanas de avisos dinmicamente
def __ventana_avisos(sonido, icono, texto, botn1 = "Ok", botn2 = None):
    layout = [
        [sg.Text(icono, font="Segoe\\ UI\\ Emoji 24")],
        [sg.Text(texto)],
        [sg.Button(botn1, k="btn_aviso_ok")]
    ]
    if botn2: layout[2].insert(0, sg.Button(botn2, k="btn_aviso_btn2"))
    winsound.Beep((660 if sonido == "xito" else (440 if sonido == "neutral" else 220)), 250)
    return sg.Window(texto, layout, element_justification="center", modal=True, keep_on_top=True)


# Funcin para crear el encabezado
def __layout_encabezado(GlobalTienda):
    return [[sg.Column([[sg.Image(data=logoURL, subsample=3)]], justification="center")],
        [sg.Column([[sg.Text(" ", key="texto_encabezado", font="Arial 10 italic", text_color="#778296")]], justification="center")],
        [sg.HorizontalSeparator(color="#021129", p=(0, 10))]]